import CardSearch from "../commons/CardSearch";

const GridS = ({ searchMovies }) => {
    return (
      <div className="cards">
        {searchMovies.map((movie) => {
          return (
            <div className="card" key={movie.id}>
              <CardSearch data={movie} />
            </div>
          );
        })}
      </div>
    );

};

export default GridS;
